import { React, Component } from "react";
import CollectionGallery from "./CollectionGallery";


class CollecionCard extends Component {
    render() {
        const collection = this.props;
        return (
            <Card style={{ width: '18rem' }}>
                <Card.Img variant="top" src="https://previews.123rf.com/images/benchart/benchart1204/benchart120400018/13237662-illustration-of-a-cartoon-opened-brown-book.jpg" />
                <Card.Body>
                    <Card.Title>{collection.name}</Card.Title>
                    <Card.Text>
                        <p>Start date: {collection.start_date}</p>
                        <p>End date: {collection.end_date}</p>
                    </Card.Text>
                    <Button variant="primary">Go somewhere</Button>
                </Card.Body>
            </Card>
        )
    }
}

export default CollectionCard
